def fetch_uniprot_id_from_pdb(pdb_id): #https://www.ebi.ac.uk/pdbe/api/mappings/uniprot/1kq2
    pdb_url = f"https://www.rcsb.org/structure/{pdb_id}"
    response = requests.get(pdb_url)

    if response.status_code == 200:
        soup = BeautifulSoup(response.text, 'html.parser')
        url_pattern = re.compile(r'https://www.uniprot.org/uniprot/(\w+)')
        a_tag = soup.find('a', href=url_pattern)
        if a_tag:
            # Extract the matched id from the URL
            matched_id = url_pattern.search(a_tag['href']).group(1)
            #print("Matched UniProt ID" + str(matched_id))
            return matched_id
        else:
            #print("No matching URL found.")
            return None

def fetch_uniprot_data(uniprot_id):
    uniprot_url = f"https://www.uniprot.org/uniprot/{uniprot_id}.txt"
    response = requests.get(uniprot_url)
    molecular_functions = []
    if response.status_code == 200:
        for line in response.iter_lines(decode_unicode=True):
            if "F:" in line and "DR   GO; " in line:
                molecular_functions.append(((line.split("; "))[-2:-1]))
        return molecular_functions
    return None

